import React from "react";
import { Nav, Navbar, Container, Row } from 'react-bootstrap'
import './starting.css';



export default function Home(){
     return(
        <Container>
        <Row>
            <col-md-2>
        <div>
            <h1>Starting  Page</h1> 
            <img src="./images/1.png"></img>
            
        </div>
        </col-md-2>
        </Row>
        </Container>

     )
}
